    public override object parseMarketLeverageTiers(object info, object market = null)
    {
        //
        //     [
        //         {
        //             "level": 1,
        //             "startUnit": 0,
        //             "endUnit": 150000,
        //             "leverage": 125,
        //             "keepMarginRate": "0.004"
        //         }
        //     ],
        //
        object tiers = new List<object>() {};
        for (object i = 0; isLessThan(i, getArrayLength(info)); postFixIncrement(ref i))
        {
            object item = getValue(info, i);
            object minNotional = this.safeNumber(item, "startUnit");
            object maxNotional = this.safeNumber(item, "endUnit");
            ((List<object>)tiers).Add(new Dictionary<string, object>() {
                { "tier", this.sum(i, 1) },
                { "currency", getValue(market, "base") },
                { "minNotional", minNotional },
                { "maxNotional", maxNotional },
                { "maintenanceMarginRate", this.safeNumber(item, "keepMarginRate") },
                { "maxLeverage", this.safeNumber(item, "leverage") },
                { "info", item },
            });
        }
        return tiers;
    }

